import React, { useEffect, useState } from 'react';
import Head from "next/head";
import Link from "next/link";
import Header from "../../../compornents/Header/header";
import Sidebar from "../../../compornents/totalSidebar"
import Json from "../../../Json/adventruer/job.json";

const Index = (props) => {
    const [num, setNum] = useState(0);

    useEffect(() => {
        document.querySelector("#__next").style.backgroundImage = `url(../../images/ranking/background.png)`;
    
        let rankingMain = document.querySelector(".ranking__main > div");
        let width = 250;    
        
        rankingMain.style.transition = ".5s";

        rankingMain.style.transform = `translateX(-${width * num}px)`;
    })

    const world = [
        "luna",
        "scania",
        "elysium",
        "croa",
        "aurora",
        "bera",
        "red",
        "union",
        "zenith",
        "enosis",
        "arcane",
        "nova"
    ]

    return (
        <div>
            <Head>
                <title>msg.gg</title>
                <link rel="stylesheet" href="/style/header.css" />
                <link rel="stylesheet" href="/style/ranking.css"/>
                <link
                    href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700&display=swap"
                    rel="stylesheet"
                ></link>
            </Head>
            <Header></Header>
            <div className="wrap">
                <Sidebar kind="World"/>
                <div className="ranking__main">
                    <img id="prev-btn" className="pointer" src="../../images/left-button.png" onClick={()=>setNum(num - 1 < 0 ? 0 : num - 1)} alt=""/>
                    <div>
                        <div className="ranking__insignia">
                            <div className="flex-center"><img src="../../images/ranking/world/luna.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/scania.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/elysium.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/croa.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/aurora.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/bera.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/red.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/union.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/zenith.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/enosis.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/arcane.png" alt=""/></div>
                            <div className="flex-center"><img src="../../images/ranking/world/nova.png" alt=""/></div>
                        </div>
                    </div>
                    <img id="next-btn" className="pointer" src="../../images/right-button.png" onClick={()=>setNum(num + 1 > world.length - 1 ? world.length - 1 : num + 1)} alt=""/>
                </div>
            </div>
        </div>
    );
};

export default Index;
